import React, { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate, useParams } from "react-router-dom";
import { Link } from "react-router-dom";

const FormUpdateProfile = () => {
    const [name, setName] = useState("");
    const [gender, setGender] = useState("");
    const [birthDate, setBirthDate] = useState("");
    const [noKtp, setNoKtp] = useState("");
    const [noRumah, setNoRumah] = useState("");

    useEffect(() => {
        const getProfile = async () => {
            try {
                const response = await axios.get(
                    `http://localhost:5000/profile`
                );
                setName(response.data.name);
                setGender(response.data.gender);
                setBirthDate(response.data.birthDate);
                setNoKtp(response.data.noKtp);
                setNoRumah(response.data.noRumah);
            } catch (error) {
                if (error.response) {
                    setMsg(error.response.data.msg);
                }
            }
        };
        getProfile();
    }, []);

    return (
        <div className="container">
            <div className="container-profile">
                <h1>Profile</h1>
                <Link to="/profile/update">
                    <button className="btn-edit">Update Profile</button>
                </Link>
                {/* <table className="profile-data" >
                    <tr>Nama
                        <td>
                            {name}
                        </td>
                    </tr>
                    <tr>Jenis Kelamin
                        <td>
                            {gender}
                        </td>
                    </tr>
                    <tr>Tanggal Lahir
                        <td>
                            {birthDate}
                        </td>
                    </tr>
                    <tr>No.KTP
                        <td>
                            {noKtp}
                        </td>
                    </tr>
                    <tr>No.Rumah
                        <td>
                            {noRumah}
                        </td>
                    </tr>
                </table> */}
                <div className="profile-data"></div>
                <label htmlFor="name">Identitas</label>
                <input value={name}></input>
                <label htmlFor="gender">Gender</label>
                <input value={gender}></input>                
                <label htmlFor="tanggal lahir">Tanggal Lahir</label>
                <input value={birthDate}></input>
                <label htmlFor="nomor ktp">Nomor KTP</label>                
                <input value={noKtp}></input>
                <label htmlFor="nomor rumah">Nomor Rumah</label>
                <input value={noRumah}></input>
            </div>
        </div>
    )
};

export default FormUpdateProfile;
